import React from 'react';
import UserSearch from './UserSearch';
import { Button, Form, Container, Nav, Navbar, NavDropdown } from 'react-bootstrap';

const NavigationHead = ({ setSearchedMember, userList, searchUsers}) => {
  return (
    <Navbar className="fixed-top bg-light shadow-sm" expand="lg">
      <Container>
        <Navbar.Brand className="fw-bold">RealTimeChat</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Form className="d-flex">
              <UserSearch setSearchedMember = {setSearchedMember} userList={userList} />
            </Form>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
    );
};

export default NavigationHead
